import React, { useEffect, useState } from 'react';
import './index.css';
import { blackpices } from './pices/blackpices/exportblackpices.js';
import { whitepices } from './pices/whitepices/exportwhitepices.js';

const App = () => {
  const [bishopwhite, kingwhite, queenwhite, rookwhite, pawnwhite, knightwhite] = whitepices;
  const [bishop, king, queen, rook, knight, pawn] = blackpices;
  const [Piece, setPiece] = useState('')
  const [Start, setStart] = useState('')
  const [End, setEnd] = useState('')
  useEffect(() => {
    const chessSquares = document.querySelectorAll('.chessSquare');
    const allPices = document.querySelectorAll('.pices');
    allPices.forEach(pice => {
      pice.addEventListener('dragstart', (e) => {
        pice.classList.add('dragable');
        setStart(pice.parentNode.id)
      });
      pice.addEventListener('dragend', () => {
        setEnd(pice.parentNode.id)
        setPiece(pice.id)
        pice.classList.remove('dragable');
      });
    });

    chessSquares.forEach(square => {
      square.addEventListener('dragover', (e) => {
        e.preventDefault();
        const draggingElement = document.querySelector('.dragable');
        if (draggingElement) {
          square.appendChild(draggingElement);
        }
      });
    });
    let position = {
      a:1,b:2,c:3,d:4,e:5,f:6,g:7,h:8
    }
function pieceposition(start,end){
  let x = position[start[0]]
  let [fromcol,fromrow] = start.split('')
  let [tocol,torow] = end.split('')
  console.log(fromcol,fromrow,tocol,torow,x)
}
pieceposition(Start, End)

    // Cleanup function to remove event listeners
    return () => {
      allPices.forEach(pice => {
        pice.removeEventListener('dragstart', () => { });
        pice.removeEventListener('dragend', () => { });
      });

      chessSquares.forEach(square => {
        square.removeEventListener('dragover', () => { });
      });
    };
  }, [Piece, End, Start]);
  // console.log(Start, End, Piece);
  return (
    <div>
      <div id="chessboard">
