        <div className="chessSquare white" id="D2"><img id='p4' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare black" id="E2"><img id='p5' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare white" id="F2"><img id='p6' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare black" id="G2"><img id='p7' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare white" id="H2"><img id='p8' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare white" id="A3"> </div>
