        <div className="chessSquare black" id="E8"><img id='K' src={king} alt="king" className="king pices" draggable="true" /></div>
        <div className="chessSquare white" id="F8"><img id='B' src={bishop} alt="bishop" className="bishop pices" draggable="true" /></div>
        <div className="chessSquare black" id="G8"><img id='N' src={knight} alt="knight" className="knight pices" draggable="true" /></div>
        <div className="chessSquare white" id="H8"><img id='R' src={rook} alt="rook" className="rook pices" draggable="true" /></div>
      </div>
    </div>
  );
};

export default App;
